import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { BrowserRouter as Routes, Route, Link } from 'react-router-dom';


import Home from './components/Home';
import Upload from './components/Uploads';
import Keyword from './components/Keyword';
import Processing from './components/Processing';
import Result from './components/Result';

function App() {
  return (
    <div className="App">
      <header>
  <Navbar expand="lg" className="navbackground">
    <Container>
      <Navbar.Brand as={Link} to="/">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/logo.png`}
          width="120"
          height="50"
          alt="MoodMelody Logo"
        />
      </Navbar.Brand>

      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="nav-links mx-auto">
          <Nav.Link as={Link} to="/">Home</Nav.Link>
          <Nav.Link as={Link} to="/upload">Upload</Nav.Link>
          <Nav.Link as={Link} to="/keyword">Keyword</Nav.Link>
          <Nav.Link as={Link} to="/processing">Processing</Nav.Link>
          <Nav.Link as={Link} to="/result">Result</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
</header>

<main className="App-main">
  <Routes>
    <Route path="/" element={<Home />} />
    <Route path="/upload" element={<Upload />} />
    <Route path="/keyword" element={<Keyword />} />
    <Route path="/processing" element={<Processing />} />
    <Route path="/result" element={<Result />} />
  </Routes>
</main>
</div>

  );
}

export default App;
